import React from 'react';
import './HomePage.css';
import { useNavigate } from 'react-router-dom';

function HomePage() {
    const navigate = useNavigate(); // useNavigate hook for navigation

    const handleSellerClick = () => {
        // Navigate to the sign-in page for sellers
        navigate('/signin?seller');
    };

    const handleBuyerClick = () => {
        // Navigate to the sign-in page for buyers
        navigate('/signin?buyer');
    };

    return (
        <div className="home-page">
            <h1>Welcome to BookTown</h1>
            <div className="buttons-container">
                <button onClick={handleSellerClick} className="btn">
                    Seller
                </button>
                <button onClick={handleBuyerClick} className="btn">
                    Buyer
                </button>
            </div>
        </div>
    );
}

export default HomePage;
